import React from 'react';
import Header from './Header';

function App() {
  let counter = 0;
  function increment(){
    counter++;
    console.log(counter);
  }
  return (
    <div>
      <Header>Contador: {counter}</Header>
      <button onClick={increment}>Inscrementar</button>
    </div>
  );
}

export default App;
